import styled from "styled-components";
import MovieItem from "../movieItem";

export const Layout = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

export const Movie = styled(MovieItem)`
  margin-bottom: 10px;
`;
